import React from "react";
import { Nav, NavLink, NavMenu } from './NavbarElements';


const Footer = () => {
    return (
      <div class="container my-3">
        <footer class="d-flex flex-wrap justify-content-between align-items-center py-3 my-4 border-top">
          <p class="col-md-4 mb-0 text-body-secondary">&copy; 2024 Tech Tana. All rights reserved.</p>
          <ul class="nav col-md-4 justify-content-end">
            <li class="nav-item"><NavLink to="/privacy_policy" activeStyle>Privacy Policy</NavLink></li>
            <li class="nav-item"><NavLink to="/terms_of_service" activeStyle>Terms of Service</NavLink></li>
          </ul>
        </footer>
      </div>
    );
  }

  
export default Footer;
